import React, { useEffect, useMemo, useState } from 'react';
import axios from 'axios';
import Papa from 'papaparse';
import './App.css';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import ProductSummary from './ProductSummary';

const axiosSource = axios.CancelToken.source();

const App = () => {
  const [previsaoData, setPrevisaoData] = useState([]);
  const [entregaData, setEntregaData] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  const [startDate, setStartDate] = useState('');
  const [endDate, setEndDate] = useState('');
  const [productFilter, setProductFilter] = useState('');

  const parseDate = (dateString) => {
    if (!dateString) return null;
    const [day, month, year] = dateString.split('/');
    return new Date(`${year}-${month}-${day}`);
  };

  const fetchSheetData = async (url, setData) => {
    try {
      const response = await axios.get(url, {
        cancelToken: axiosSource.token,
      });

      return new Promise((resolve, reject) => {
        Papa.parse(response.data, {
          header: true,
          skipEmptyLines: true,
          dynamicTyping: true,
          complete: (result) => {
            setData(result.data);
            resolve();
          },
          error: (error) => reject(error),
        });
      });
    } catch (error) {
      if (!axios.isCancel(error)) {
        throw error;
      }
    }
  };

  const combinedData = useMemo(() => {
    if (!previsaoData.length || !entregaData.length) return [];

    return previsaoData.map((previsaoItem) => {
      const entregas = entregaData.filter(
        (item) =>
          item.Codigo === previsaoItem.Codigo &&
          item['Data Referente (Planejada)'] === previsaoItem['Data de Previsão de Entrega']
      );

      const quantidadeEntregue = entregas.reduce(
        (acc, curr) => acc + (curr['Quantidade Entregue'] || 0),
        0
      );

      const quantidadeFaltante = Math.max(
        (previsaoItem['Quantidade Prevista'] || 0) - quantidadeEntregue,
        0
      );

      return {
        ...previsaoItem,
        QuantidadeEntregue: quantidadeEntregue,
        QuantidadeFaltante: quantidadeFaltante,
      };
    });
  }, [previsaoData, entregaData]);

  const filteredData = useMemo(() => {
    return combinedData.filter((item) => {
      const itemDate = parseDate(item['Data de Previsão de Entrega']);

      const matchesDateFilter =
        (!startDate || itemDate >= parseDate(startDate)) &&
        (!endDate || itemDate <= parseDate(endDate));

      const matchesProductFilter =
        !productFilter ||
        (item.Codigo && item.Codigo.toString().includes(productFilter));

      return matchesDateFilter && matchesProductFilter;
    });
  }, [combinedData, startDate, endDate, productFilter]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        setError(null);
        setLoading(true);

        await Promise.all([
          fetchSheetData(
            'https://docs.google.com/spreadsheets/d/1dgVHy_i0djzz8ncd1L2zOkzI3qy7YSbT7CvV_BPgXm0/gviz/tq?tqx=out:csv&sheet=Previsao',
            setPrevisaoData
          ),
          fetchSheetData(
            'https://docs.google.com/spreadsheets/d/1dgVHy_i0djzz8ncd1L2zOkzI3qy7YSbT7CvV_BPgXm0/gviz/tq?tqx=out:csv&sheet=Entrega',
            setEntregaData
          ),
        ]);
      } catch (error) {
        console.error('Erro ao carregar dados:', error);
        setError('Erro ao carregar dados. Tente recarregar a página.');
      } finally {
        setLoading(false);
      }
    };

    fetchData();

    return () => axiosSource.cancel('Componente desmontado');
  }, []);

  return (
    <Router>
      <div className="container">
        <h1>Dados Compilados</h1>

        <div className="nav">
          <Link to="/">Início</Link>
          <Link to="/resumo">Resumo por Produto</Link>
        </div>

        <Routes>
          <Route
            path="/"
            element={
              <div>
                <h2>Filtros</h2>
                <label>
                  Data Inicial:
                  <input
                    type="date"
                    value={startDate}
                    onChange={(e) => setStartDate(e.target.value)}
                  />
                </label>
                <label>
                  Data Final:
                  <input
                    type="date"
                    value={endDate}
                    onChange={(e) => setEndDate(e.target.value)}
                  />
                </label>
                <label>
                  Filtro por Código de Produto:
                  <input
                    type="text"
                    value={productFilter}
                    onChange={(e) => setProductFilter(e.target.value)}
                  />
                </label>
                {loading && <div>Carregando...</div>}
                {error && <div>{error}</div>}
              </div>
            }
          />
          <Route
            path="/resumo"
            element={<ProductSummary combinedData={filteredData} />}
          />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
